import React from 'react';
import Navigation from '../components/Navigation';
import BlocVoitures from '../components/BlocVoitures';
import Footer from '../components/Footer';

const Accueil = () => {
    return (
        <div>
            <Navigation />
            <h1>Accueil</h1>
            <BlocVoitures />
            <Footer />

        </div>
    );
};

export default Accueil;
